void generateMap(){
    for (int i=0;i<width;i++){
        for (int j=0;j<height;j++){
            ::map[i][j] = 0;
            if ((float)rand()/(float)RAND_MAX > 0.75){
                ::map[i][j] = 1;
            }
        }
    }
}
void outputMap(int map[width][height]){
    cout<<"Map\n";
    for (int i=0;i<width;i++){
        for (int j=0;j<height;j++){
            cout<<map[i][j];
        }
        cout<<endl;
    }
}


struct coordinates { int pos[2];};
class AStar{
    public:

int manhattenDistance(int x1,int y1,int x2,int y2){
    //linear movement - no diagonals - just cardinal directions (NSEW)
    return abs(x1 - x2) + abs(y1 - y2);
}
struct node {
    vector<coordinates> path; //Path Taken
    int x,y;
    int f=0,g=0;
};
int distanceFunction(coordinates Point, coordinates Goal){
    return manhattenDistance(Point.pos[0], Point.pos[1], Goal.pos[0], Goal.pos[1]);
}

bool canWalkhere(int x,int y){
    return (::map[x][y] ==0); //Walkable Tile Value
}

 vector<coordinates> Neighbours(int x,int y){
    int North = y-1,
    South = y+1,
    East = x+1,
    West = x-1;
    bool NorthConnected = false, SouthConnected = false, EastConnected = false, WestConnected = false;
    if (North>-1){if (canWalkhere(x,North)){NorthConnected = true;}}
    if (South<height){if (canWalkhere(x,South)){SouthConnected = true;}}
    if (East<width){if (canWalkhere(East,y)){EastConnected = true;}}
    if (West>-1){if (canWalkhere(West, y)){WestConnected =  true;}}

    vector<coordinates> neighbours;
    if (NorthConnected){
        neighbours.push_back({x,North});}
    if (SouthConnected){
        neighbours.push_back({x,South});}
    if (EastConnected){
        neighbours.push_back({East,y});}
    if (WestConnected){
        neighbours.push_back({West,y});}
    //findNeighbours(NorthConnected, SouthConnected, EastConnected, WestConnected, North, South, East, West, neighbours);

    return neighbours;
}
vector<coordinates> calculatePath(coordinates start, coordinates end){
    int visited[width][height]; //Visited Nodes
    for (int i=0;i<width;i++){
        for (int j=0;j<height;j++){
            visited[i][j] = 0;
        }
    }
    // create Nodes from Start and End x, y coordintes
    node pathStart;
    pathStart.x = start.pos[0];
    pathStart.y = start.pos[1];

    vector<node> Open;
    Open.push_back(pathStart); //Possible Paths

    //vector<node> Closed; // Dead Ends
    vector <coordinates> result;
    if (!canWalkhere(end.pos[0],end.pos[1]))return result;


    int max, min;
    //Iterate through openlist until no nodes left
    while (!Open.empty()){
        max = width*height; //worldSize; //Max Cost
        min = 0; //Minimum Cost
        for (int i=0; i<(int)Open.size();i++){
            if (Open[i].f < max){ // If there is a smaller cost from start
                max = Open[i].f;
                min = i;
            }
        }

        //grab next node and remove it from Open array
        node myNode = Open[min];//Open.splice(min, 1)[0];
        Open.erase(Open.begin() + min);;

        //Is it destination node?
        if (myNode.x == end.pos[0] && myNode.y == end.pos[1]){
            //Closed.push_back(myNode);
            //node myPath = Closed[Closed.size()-1];

            myNode.path.push_back(end);
            //return myPath.path;
            result = myNode.path;

        }
        else{ //not destination
            vector <coordinates> myNeighbours = Neighbours(myNode.x, myNode.y);
            for (int i=0;i<(int)myNeighbours.size();i++){
                node myPath;
                myPath.path = myNode.path;
                myPath.path.push_back({myNode.x, myNode.y});
                //cout<< myNeighbours[i].pos[0]<<","<< myNeighbours[i].pos[1]<<endl;
                myPath.x = myNeighbours[i].pos[0];
                myPath.y = myNeighbours[i].pos[1];

                /*for (int j=0;j<(int)myPath.path.size();j++){
                cout<<myPath.path[0].pos[0]<<","<<myPath.path[0].pos[1]<< " ";}
                cout<<endl;*/
                if (!visited[myPath.x][myPath.y]){ //If not visited before
                    //estimated cost of this particular route so far
                    myPath.g = myNode.g + distanceFunction(myNeighbours[i], {myNode.x,myNode.y});
                    //estimated cost of this particular route so far
                    myPath.f = myPath.g + distanceFunction(myNeighbours[i], {end.pos[0],end.pos[1]}
                                                           );

                    //Next Nodes to visit
                    Open.push_back(myPath);
                    //mark this node in the world graph as visited
                    visited[myPath.x][myPath.y] = true;

                }

            }
            //remember this route has having no more untested options
            //Closed.push_back(myNode);
        }
    }
    return result;

}

};






